import "./App.css";
import Navbar from "./Component/navbar.jsx";
import FeedBack_user from "./Component/FeedBack_user.jsx";
import About from "./Component/about.js";
import McqPage from "./Component/McqPage.jsx";
import LoginPages from "./Component/loginPages.js";
import ShowFeedback from "./Component/ShowFeedback.jsx";

import { BrowserRouter, Routes, Route } from "react-router-dom";
import Plan from "./Component/Plan.js";
import QuizSetup from "./Component/QuizSetup.jsx";
import Quiz1 from "./Component/Quiz1.jsx";
import Quiz from "./Component/Quiz.jsx";
import QbankMaster from "./Component/QbankMaster.jsx";
import EditableQbankData from "./Component/EditableQbankData.jsx";
import { AuthProvider } from "react-auth-kit";

function App() {
  return (
    //routers concept implimentation
    <AuthProvider>
      <BrowserRouter>
        <Navbar title="Railway MCQ" quiz="MCQ Section" />

        <Routes>
          <Route path="/" element={<About />} />
          <Route path="/FeedBack_user" element={<FeedBack_user />} />
          <Route path="About" element={<About />} />
          <Route path="LoginPages" element={<LoginPages />} />
          <Route path="/Plan" element={<Plan />} />
          <Route path="/McqPage" element={<McqPage />} />
          <Route path="/QuizSetup" element={<QuizSetup />} />
          <Route path="/Quiz" element={<Quiz />} />
          <Route path="/Quiz1" element={<Quiz1 />} />
          <Route path="/EditableQbankData" element={<EditableQbankData />} />
          <Route path="/QbankMaster" element={<QbankMaster />} />
          <Route path="/ShowFeedback" element={<ShowFeedback />} />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
